import React from "react"; 
import logo from '../Images/logo.png';
import {NavLink} from 'react-router-dom';
import '../Css/Header.css';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';


const Header=()=>{
    return(
        <>
            <header>
                <div className="container container-flex display-flex">
                    <div className="logo w-100">
                        <img src={logo} alt="aivys-logo" />
                    </div>
                    <nav>
                        <div className="list">
                            <NavLink to="/" className="listItem" activeClassName="activeItem">Home</NavLink>
                            <NavLink to="/about" className="listItem" activeClassName="activeItem">About</NavLink>
                            <NavLink to="/couture" className="listItem" activeClassName="activeItem">Couture Process</NavLink>
                            <NavLink to="/store" className="listItem" activeClassName="activeItem">Store</NavLink>
                            <NavLink to="/contact" className="listItem" activeClassName="activeItem">Contact</NavLink>
                        </div>
                    </nav>



                    <div>
                        <button><NavLink>Book a Consultation</NavLink></button>
                    </div>
                </div>
            </header>
        </>
    )
}
export default Header;
